window.bookSummaryJSON = "<p>A devilish grin. Six-pack abs. And horns!</p> <p>When I enlist the help of Redrock Protective Services, I expect to meet with one of the company’s gargoyle brothers. Instead, I find myself face-to-face with a demon. And by the heated glow in his eyes, guarding is the last thing he wants to do with my body.<br> <br> Eamon is rippling with muscles, rides a motorcycle, and has extra, uh...parts...for my pleasure—all the things that have my body screaming <i>YES!</i> Too bad a demon lover is a distraction I can’t afford, not when I’m running from a centuries-old spirit intent on stealing my identity.<br> <br> But every second I spend in Eamon's penthouse makes me fall a little more for him as I uncover his caring and gentle side, and soon, I’m in over my head.<br> <br> Wrapped up in the arms of my very own possessive monster, I search for a permanent solution to my problem. Can I find it in time, or am I doomed to lose myself forever?<br> <br> Date with a Demon is a stand-alone paranormal romance with a hunky, protective demon, mouthy witches, and evil wizards. Sweet and steamy. HEA guaranteed.</p>"; 
